import React from 'react';
import CardList from './CardList';
import {robots } from './robots';
import Searchbox from './S'

const App = () => {
    return (
        <div>
        <h1>RoboFriends</h1>
        <Searchbox />
        <CardList robots = {robots}/>
        </div>
    );
}

export default App;
